import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
        <Header />
        <Techno />
    </div>
  );
}

const Header = () => {
    return (
     <div>
         <ul>
             <li>FIRST</li>
             <li>TWO</li>
             <li>FREE</li>
         </ul>
     </div>
);
}

const Techno = () => {
    return (
        <div className="App">
            <a href="#s">One</a>
            <a href="#s">Two</a>
            <a href="#s">Tree</a>
        </div>
    );
}

export default App;
